	@RequestMapping(value = "/hdbpredict")
	public String hdbpredict(@Valid @ModelAttribute("prediction") Prediction prediction, BindingResult res, Model model, @RequestParam String area, @RequestParam String year,
			@RequestParam String storey, @RequestParam String town, @RequestParam String street) {
		
		if(res.hasErrors()) {
			int k = 0;

			for (int i = 0; i < counters.length; i++) {
				List<String> st = new ArrayList<>();
				for (int j = k; j < k + counters[i]; j++) {
					st.add(STREETS[j]);
				}
				k = k + counters[i];
				mapper.put(TOWNS[i], st);
			}
			String[] townCopy = TOWNS.clone();
			List<String> sortedTowns = Arrays.asList(townCopy);
			Collections.sort(sortedTowns);
			model.addAttribute("towns", sortedTowns);
						
			return "priceForm";
		}

		String newhdburl = String.format(hdburl, area, year, storey, town, street);

		String result = getPrice(newhdburl);

		model.addAttribute("area", area);
		model.addAttribute("year", year);
		model.addAttribute("storey", storey);
		model.addAttribute("town", town);
		model.addAttribute("street", street);

		model.addAttribute("result", result);

		Pattern pattern = Pattern.compile("-?\\d+.+");

		if (pattern.matcher(result).matches()) {
			return "result";
		} else {
			return "errorMsg";
		}

	}

